import './App.css';

import Main from './pages/main';
import Player from './pages/playing'

function App() {
  return(
    <Router>
      <Routes>
        <Route path="setup" element={<Main/>}/>
        <Route path="game" element={<Player/>}/>
      </Routes>
    </Router>
  )
}

export default App;
